import React from "react";
import ReactDOM from "react-dom/client";
import "./fstyle.css";

const root = ReactDOM.createRoot(document.getElementById("root"));

// Navbar component
function Navbar() {
  return (
    <div>
      <h1>Navbar</h1>
      {/* Add your navbar content here */}
    </div>
  );
}

// Render the Navbar component inside the root
root.render(<Navbar />);
